- input: "TEXT\x1CC00191288\x1C.TEXT\x1C\x1CF3XA\x1CThe Sept. 20th Monthly report
    is being amended on 9/26/11 to fix the year-to-date errors in the original filing.
    \ These errors occured due to a corrupt .dcf file that occured during the filing
    of the original report with the FECFile software, causing contribution and expenditure
    history for previous 2011 reports to be deleted.  The amended report does not
    change any substantive contribution or expenditure data and no additional amounts
    are reported.  Some contributions that had been listed as unitemized in the original
    report are now itemized due to the recovering of the previous 2011 information.
    \ The federal share of operating expenses is also higher than the original filing
    due to an amendment to the Feb 20th monthly report earlier today correcting the
    allocation ratio for adminstrative expenses.  The reported receipts and disbursements
    amounts are unchanged from the originally filed report.\n"
